import Head from 'next/head';

function Home() {
  return (
    <>
        <h1>For party planners that are not freaks in the spreadsheets</h1>
        <img src="/logo.png"/>
          <form
            style={{
                display: "flex",
                flexDirection: "row",
                justifyContent: "center"
            }}
            name="contact"
            method="post"
            data-netlify="true"
            data-netlify-honeypot="bot-field"
            onSubmit={handleSubmit}
        >
        </form>
    </>
  );
}

export default Home;
